import React from 'react';
import './Navigation.css';
import { Nav, Navbar, NavbarCollapse, NavbarContext, NavbarToggle } from 'react-bootstrap';


const Navigation = () => {
	return (
		<div className='MainNav'>
  			<Navbar bg="white" expand="lg">
			  <Navbar.Toggle aria-controls="basic-navbar-nav" />
			  <Navbar.Collapse id="basic-navbar-nav">
			    <Nav className="mr-auto MainMenu">
			      <Nav.Link href="#home" className="pr-4">home</Nav.Link>
			      <Nav.Link href="#events" className="pr-4">events</Nav.Link>
			      <Nav.Link href="#listen" className="pr-4">listen</Nav.Link>
			      <Nav.Link href="https://pressuresensitive.bandcamp.com/" className="pr-4">store</Nav.Link>
			      <Nav.Link href="#contact" className="pr-4">contact</Nav.Link>
			    </Nav>
			  </Navbar.Collapse>
			</Navbar>
  		</div>
	);
}

export default Navigation;
